import {Button,TextField, TextStyle, EmptyState, Layout, Page } from '@shopify/polaris';

const img = 'https://cdn.shopify.com/s/files/1/0757/9955/files/empty-state.svg';

function TextFieldExample() {
  const [value, setValue] = useState('Jaded Pixel');

  const handleChange = useCallback((newValue) => setValue(newValue), []);

  return <TextField label="Store name" value={value} onChange={handleChange} />;
}

const Index = () => (
    // <TextFieldExample />
    <EmptyState>
        <TextFieldExample />
        <TextField label="Store name"  ></TextField>
        <Button onClick={() => alert(TextField.valueOf())}>Example button</Button>
    </EmptyState>

);

export default Index;
